import React, { useState } from 'react';
import logincss from '../assets/css/login.css';
import Mainlayout from '../layout/mainlayout';
import axios from 'axios';
// import { useNavigate } from 'react-router-dom';

function Logister() {
    // Step 1: Define state to manage the active panel
    const [isRightPanelActive, setIsRightPanelActive] = useState(false);

    // Step 2: Create event handlers
    const handleSignUp = () => {
        setIsRightPanelActive(true);
    };

    const handleSignIn = () => {
        setIsRightPanelActive(false);
    };
    // const navigate = useNavigate()

    const [name, setName] = useState()
    const [email, setEmail] = useState()
    const [mobile, setMo] = useState()
    const [address, setAddress] = useState()
    const [password, setPassword] = useState()

    const handleSubmit = (e) => {
        e.preventDefault()
        axios.get('http://localhost:3001/logister', {name,email,mobile,address,password})
        .then(result =>{console.log(result)
            // navigate('/seminars')
            window.location.reload();
        })
        .catch(err=> console.log(err))
    }
    const handleSubmitlogin = (e) => {
        e.preventDefault()
        axios.post('http://localhost:3001/logister', {})
        .then(result =>{console.log(result)
            // navigate('/seminars')
            window.location.reload();
        })
        .catch(err=> console.log(err))
    }
    return (
        <Mainlayout>
            <div>
                <head>
                    <meta charSet="UTF-8" />
                    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
                    <title>Login</title>
                    <link rel="stylesheet" href={logincss} />
                </head>
                <body id='loginbody'>
                    {/* <h1 className={`containerlogin ${isRightPanelActive ? 'active' : ''}`}>jwhegfvewjyflffwv</h1> */}
                    <div id="container" className={`${isRightPanelActive ? 'right-panel-active' : ''}`}>
                        <div className="form-container sign-up-container">
                            <form className="frm" onSubmit={handleSubmit}>
                                <h1 className="h1" id='titleregi'>Create Account</h1>
                                <input className="inp" type="text" placeholder="Full Name" onChange={(e)=>setName(e.target.value)}/>
                                <input className="inp" type="email" placeholder="Email" onChange={(e)=>setEmail(e.target.value)} />
                                <input className="inp" type="text" placeholder="Mobile No" onChange={(e)=>setMo(e.target.value)} />
                                <input className="inp" type="text" placeholder="Address" onChange={(e)=>setAddress(e.target.value)} />
                                <input className="inp" type="password" placeholder="Password" onChange={(e)=>setPassword(e.target.value)} />
                                <input className="inp" type="password" placeholder="Confirm Password" />
                                <button className="lgbtn">Sign Up</button>
                            </form>
                        </div>
                        <div className="form-container sign-in-container">
                            <form action="#" className="frm">
                                <h1 className="h1">Sign in</h1>
                                <input className="inp" type="email" placeholder="Email" />
                                <input className="inp" type="password" placeholder="Password" />
                                <a id='ancor' href="#">Forgot your password?</a>
                                <button className="lgbtn">Sign In</button>
                            </form>
                        </div>
                        <div className="overlay-container">
                            <div className="overlay">
                                <div className="overlay-panel overlay-left">
                                    <h1 className="h1 hello">Welcome Back!</h1>
                                    <p className="para">To keep connected with us please login with your personal info</p>
                                    <button className="ghost lgbtn" id="signIn" onClick={handleSignIn}>Sign In</button>
                                </div>
                                <div className="overlay-panel overlay-right">
                                    <h1 className="h1 hello">Hello, Friend!</h1>
                                    <p className="para">New user signUp here</p>
                                    <button className="ghost lgbtn" id="signUp" onClick={handleSignUp}>Sign Up</button>
                                </div>
                            </div>
                        </div>
                    </div>
                </body >
            </div >
        </Mainlayout>
    );
}

export default Logister;
